import styled from 'styled-components'

const Input = styled.input`
  margin: 54px 0 auto;
  outline: none;
  max-width: 420px;
  text-align: center;
  border-radius: 6px;
  background: #f1f1f1;
  font-size: 1.1rem;
`
export default () => Input
